,p_data_source_type=>'SQL'
,p_data_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'with ',
'value_amt_rur as (',
'    select first_name||'' ''||last_name as client_name,',
'           f_conv_to_rur(value_amt, :P15_USD) as value_amt,',
'           value_day',
'    from transactions',
'    where  currency_code = ''USD''',
'    UNION ALL',
'    select first_name||'' ''||last_name as client,',
'           f_conv_to_rur(value_amt, :P15_EUR) as value_amt,',
'           value_day',
'    from transactions',
'    where  currency_code = ''EUR''',
'    UNION ALL',
'    select first_name||'' ''||last_name as client,',
'           value_amt,',
'           value_day',
'    from transactions',
'    where  currency_code = ''RUR''),',
'    ',
'cities as (',
'    select first_name||'' ''||last_name as client_name,',
'           city',
'    from visiting',
'    group by first_name||'' ''||last_name, city)',
'',
'select sum(var.value_amt) as value_sum,',
'       c.city as city',
'from   cities c',
'     join   value_amt_rur var',
'       on   c.client_name = var.client_name',
'where to_number(to_char(var.value_day, ''mm'')) = :P15_MONTH',
'and   to_number(to_char(var.value_day, ''yyyy'')) = :P15_YEAR',
'group by c.city',
'order by c.city;'))
